class LowLevelFeatures(nn.Module):
    def __init__(self):
        super(LowLevelFeatures, self).__init__()
        self.layers = nn.Sequential(
            nn.Conv2d(1, 64, kernel_size=3, stride=1, padding=1),  # Conv1 (256x256)
            nn.ReLU(),
            nn.Conv2d(64, 128, kernel_size=3, stride=2, padding=1),  # Conv2 (128x128)
            nn.ReLU(),
            nn.Conv2d(128, 128, kernel_size=3, stride=1, padding=1),  # Conv3 (128x128)
            nn.ReLU(),
            nn.Conv2d(128, 256, kernel_size=3, stride=2, padding=1),  # Conv4 (64x64)
            nn.ReLU(),
            nn.Conv2d(256, 256, kernel_size=3, stride=1, padding=1),  # Conv5 (64x64)
            nn.ReLU(),
            nn.Conv2d(256, 512, kernel_size=3, stride=2, padding=1),  # Conv6 (32x32)
            nn.ReLU()
        )

    def forward(self, x):
        return self.layers(x)

class MidLevelFeatures(nn.Module):
    def __init__(self):
        super(MidLevelFeatures, self).__init__()
        self.layers = nn.Sequential(
            nn.Conv2d(512, 512, kernel_size=3, stride=1, padding=1),  # Conv7 (32x32)
            nn.ReLU(),
            nn.Conv2d(512, 256, kernel_size=3, stride=1, padding=1)   # Conv8 (32x32)
        )

    def forward(self, x):
        return self.layers(x)

class GlobalFeatures(nn.Module):
    def __init__(self):
        super(GlobalFeatures, self).__init__()
        self.layers = nn.Sequential(
            nn.Conv2d(512, 512, kernel_size=3, stride=2, padding=1),  # Downsample (16x16)
            nn.ReLU(),
            nn.Conv2d(512, 512, kernel_size=3, stride=2, padding=1),  # Downsample (8x8)
            nn.ReLU(),
            nn.Conv2d(512, 512, kernel_size=3, stride=2, padding=1),  # Downsample (4x4)
            nn.ReLU(),
            nn.Flatten(),
            nn.Linear(512 * 4 * 4, 1024),
            nn.ReLU(),
            nn.Linear(1024, 1000)
        )

    def forward(self, x):
        return self.layers(x)

class Fusion(nn.Module):
    def __init__(self):
        super(Fusion, self).__init__()
        self.fc = nn.Linear(1000, 256 * 32 * 32)  # Match spatial dimensions
        self.upsample = nn.Upsample(scale_factor=2, mode='bilinear', align_corners=False)

    def forward(self, mid_features, global_features):
        # Expand global features
        global_features = self.fc(global_features).view(-1, 256, 32, 32)
        fused = mid_features + global_features
        return self.upsample(fused)  # Upsample to 64x64

class Decoder(nn.Module):
    def __init__(self):
        super(Decoder, self).__init__()
        self.layers = nn.Sequential(
            nn.Conv2d(256, 128, kernel_size=3, stride=1, padding=1),  # Conv (64x64)
            nn.ReLU(),
            nn.Upsample(scale_factor=2, mode='bilinear', align_corners=False),  # 128x128
            nn.Conv2d(128, 64, kernel_size=3, stride=1, padding=1),
            nn.ReLU(),
            nn.Upsample(scale_factor=2, mode='bilinear', align_corners=False),  # 256x256
            nn.Conv2d(64, 2, kernel_size=3, stride=1, padding=1),  # Predict ab (256x256)
            nn.Tanh()  # Normalize to [-1, 1]
        )

    def forward(self, x):
        return self.layers(x)

class ColorizationNet(nn.Module):
    def __init__(self):
        super(ColorizationNet, self).__init__()
        self.low_level = LowLevelFeatures()
        self.mid_level = MidLevelFeatures()
        self.global_features = GlobalFeatures()
        self.fusion = Fusion()
        self.decoder = Decoder()

    def forward(self, l_channel):
        low_features = self.low_level(l_channel)  # 32x32
        mid_features = self.mid_level(low_features)  # 32x32
        global_features = self.global_features(low_features)  # 1000
        fused = self.fusion(mid_features, global_features)  # 64x64
        ab_channels = self.decoder(fused)  # 256x256
        return ab_channels

"""##Image Loader Functions"""

def preprocess_image(image_path):
    # Load image and convert to LAB color space
    img = cv2.imread(image_path)
    img_lab = cv2.cvtColor(img, cv2.COLOR_BGR2Lab)
    l_channel, a_channel, b_channel = cv2.split(img_lab)

    # Normalize L to [0, 1] and ab to [-1, 1]
    l_channel = l_channel / 255.0
    a_channel = (a_channel - 128) / 128.0
    b_channel = (b_channel - 128) / 128.0

    return l_channel, np.stack([a_channel, b_channel], axis=0)

class ColorizationDataset(Dataset):
    def __init__(self, image_paths):
        self.image_paths = image_paths

    def __len__(self):
        return len(self.image_paths)

    def __getitem__(self, idx):
        l, ab = preprocess_image(self.image_paths[idx])
        return torch.tensor(l, dtype=torch.float32).unsqueeze(0), torch.tensor(ab, dtype=torch.float32)

"""#Model Training, Evaluation"""

# Training Dataset and DataLoader
train_dataset = ColorizationDataset(train_paths)
train_loader = DataLoader(train_dataset, batch_size=16, shuffle=True)

# Testing Dataset and DataLoader
test_dataset = ColorizationDataset(test_paths)
test_loader = DataLoader(test_dataset, batch_size=16, shuffle=False)

device = torch.device("cuda" if torch.cuda.is_available() else "cpu")
print(f"Using device: {device}")

import torch.optim as optim

# Instantiate model, optimizer, and device
model = ColorizationNet().to(device)
criterion = nn.MSELoss()
optimizer = optim.Adam(model.parameters(), lr=1e-3)

for epoch in range(10):  # Number of epochs
    model.train()
    total_loss = 0
    for l_channel, ab_channel in train_loader:
        l_channel = l_channel.to(device)
        ab_channel = ab_channel.to(device)

        # Forward pass
        ab_pred = model(l_channel)

        # Compute loss
        loss = criterion(ab_pred, ab_channel)
        total_loss += loss.item()

        # Backward pass
        optimizer.zero_grad()
        loss.backward()
        optimizer.step()

    print(f"Epoch {epoch+1}, Loss: {total_loss / len(train_loader):.4f}")

import matplotlib.pyplot as plt
from skimage.color import lab2rgb

model.eval()
with torch.no_grad():
    for l_channel, ab_channel in test_loader:
        l_channel = l_channel.to(device)
        ab_channel = ab_channel.to(device)

        # Predict ab
        ab_pred = model(l_channel)
        ab_pred = ab_pred.cpu().numpy() * 128.0  # Denormalize ab

        # Combine L and ab
        l_channel = l_channel.cpu().numpy() * 100.0  # Denormalize L
        for i in range(4):  # Visualize 4 images
            lab = np.dstack((l_channel[i, 0], ab_pred[i, 0], ab_pred[i, 1]))
            rgb = lab2rgb(lab)
            plt.imshow(rgb)
            plt.axis('off')
            plt.show()

import cv2

def save_predictions(model, test_loader, output_folder):
    model.eval()
    os.makedirs(output_folder, exist_ok=True)
    with torch.no_grad():
        for idx, (l_channel, _) in enumerate(test_loader):
            l_channel = l_channel.float().to(device)

            # Predict chrominance channels
            ab_pred = model(l_channel).cpu().numpy()

            # Save predicted images
            for i in range(len(ab_pred)):
                l = l_channel[i].squeeze().cpu().numpy() * 255.0
                ab = ab_pred[i].transpose(1, 2, 0)  # Convert to HxWxC
                ab[..., 0] = (ab[..., 0] * 128) + 128
                ab[..., 1] = (ab[..., 1] * 128) + 128

                # Combine L and ab channels
                lab = np.dstack((l, ab[..., 0], ab[..., 1]))
                rgb = cv2.cvtColor(lab.astype(np.uint8), cv2.COLOR_Lab2BGR)

                # Save the image
                cv2.imwrite(os.path.join(output_folder, f"output_{idx}_{i}.jpg"), rgb)

# Save predictions to folder
save_predictions(model, test_loader, output_folder="predicted_images")

